configure:
  commands:
    end:
      new_state: execute
    line console 0:
      new_state: configure_line
    no ipv6 route 2009::/64 TenGigabitEthernet2/2/0/35 nexthop-vrf vrf1: "no ipv6\
      \ route 2009::/64 TenGigabitEthernet2/2/0/35 nexthop-\b\b\b\b\b\b\b\b\b\b\b\b\
      \b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\
      \b\b\b\b\b\b\b\b\b$te 2009::/64 TenGigabitEthernet2/2/0/35 nexthop-v       \
      \  \b\b\b\b\b\b\b\b\brf vrf1\r\n"
    no logging console: ''
  prompt: Stargazer(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: Stargazer(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: Stargazer#
